import React from 'react'
import useStyles from './styles';
import styles from './ThankYou.css';


function ThankYou() {
    const classes = useStyles();

    return (
        <div>
            <div className={classes.toolbar} />
            <h1>Thank You</h1>
            <p id="thanksmessage">We appreciate every visit to our store. Thank you for your contribution to our cause. We have a long road ahead of us, yet we hardy heads must trudge on. Godspeed, internet denizen. </p>
        </div>
    )
}

export default ThankYou;
